```arduino
int dotDuration = 200;  // Duration of a dot in milliseconds
int buzzerPin = 8;      // Pin where the buzzer is connected

// Function to play Morse code
void playMorseCode(char c) {
  int i;
  for (i = 0; i < strlen(morseCode[c]); i++) {
    if (morseCode[c][i] == '.') {
      // Play a dot
      digitalWrite(buzzerPin, HIGH);
      delay(dotDuration);
      digitalWrite(buzzerPin, LOW);
      delay(dotDuration);
    } else if (morseCode[c][i] == '-') {
      // Play a dash
      digitalWrite(buzzerPin, HIGH);
      delay(dotDuration * 3);
      digitalWrite(buzzerPin, LOW);
      delay(dotDuration);
    }
  }
  // Space between words
  delay(dotDuration * 3);
}

void setup() {
  pinMode(buzzerPin, OUTPUT);
  // Example message to convert
  String message = "SOS";
  for (int i = 0; i < message.length(); i++) {
    char c = toupper(message[i]);
    playMorseCode(c);
  }
}

void loop() {
  // No need for loop as we only play once
}
```

